import React, {Component} from "react";
import {Container} from 'react-bootstrap';
import { Route, BrowserRouter as Router, Switch } from "react-router-dom";
class Body extends Component{

    render(){
            return(<Container>
                <Router>
                    <Switch>
                        <Route path="/ component"></Route>
                    </Switch>
                </Router>
            </Container>);
    }
}

export default Body;
